targetNode:

		@font-face {
			font-family: 'IKEA_Iconfont';
			src:url('/ie/en/font/4-13-13/ikea/shared/css/ikea_iconfont.svg#icomoon') format('svg'),
				url('/ie/en/font/4-13-13/ikea/shared/css/ikea_iconfont.woff') format('woff'),
				url('/ie/en/font/4-13-13/ikea/shared/css/ikea_iconfont.ttf') format('truetype');
			font-weight: normal;
			font-style: normal;
		}

		@media screen {
			[type="radio"] + label:before,
		    [type="checkbox"] + label:before {

 background-image: url(/ie/en/img/4-13-13/asset/form-sprite.svg); }	}	

		.zoom-image-cursor {
			  cursor: zoom-in;
			  cursor: -webkit-zoom-in;
			  cursor: -moz-zoom-in;
			  cursor: url('/ie/en/img/4-13-13/ikea/shared/cursor/zoom-in.cur'), auto;
		}
